class Solution:
    def gcdOfStrings(self, str1, str2):
        if str1 == str2: return str1
        result = ""
        div = ""
        for i in range(min(len(str1), len(str2))):
            div += str1[i]
            if str1[i] not in str2: return ""
            if not "".join(str1.split(div)) and \
               not "".join(str2.split(div)): result = div
        return result

element = Solution()
print(element.gcdOfStrings(str1, str2))